import GridLayout from "react-grid-layout";

function App(params) {
	const layout = [
		{ i: "a", x: 0, y: 0, w: 12, h: 6 },
		{ i: "b", x: 0, y: 1, w: 5, h: 5 },
		{ i: "c", x: 1, y: 1, w: 5, h: 5 }
	];
	return (
		<Grid container spacing={2}>
			<Grid item xs={8}>
				<Item>xs=8</Item>
			</Grid>
			<Grid item xs={4}>
				<Item>xs=4</Item>
			</Grid>
			<Grid item xs={4}>
				<Item>xs=4</Item>
			</Grid>
			<Grid item xs={8}>
				<Item>xs=8</Item>
			</Grid>
		</Grid>
	);
}
export default App;
